import './register.css';
import React, { useState } from 'react';

function Register() {
  const [values, setValue] = useState({
    firstName:'',
    lastName:'',
    email:''
  });
  const [aubmit, setSubmit] = useState({});
  
  const handleFirstNameInput =(event) => {
    setValue({...values,firstName: event.target.value})
  };
  const handleLastNameInput =(event) => {
    setValue({...values,lastName: event.target.value})
  };
  const handleEmailInput =(event) => {
    setValue({...values,email: event.target.value})
  };
  
  return (
    <>
    <div className='all'>
      <form className='register' >
        <div className = "success">Success! Tahnk you for registering</div>
          <input
          type='text'
          value={values.firstName}
          className = 'form'
          name = 'firstName'
          placeholder = 'First Name'
          onChange = {handleFirstNameInput}
        />
        <input
          type='text'
          value={values.lastName}
          className = 'form'
          name = 'lastName'
          placeholder = 'Last Name'
          onChange = {handleLastNameInput}
        />
        <input
         type='email'
         value={values.email}
         className = 'form'
         name = 'email'
         placeholder = 'Email'
         onChange = {handleEmailInput}
        />
        <button type='submit'>
          Register
        </button>
      </form>
    </div>
  </>

  );
    
}

export default Register;
